class Sube{  String id;  String name;  List<String> yetkiliKullanicilar;  Sube({required this.id, required this.name, required this.yetkiliKullanicilar});  factory Sube.fromJson(Map<String, dynamic> json) {    return Sube(      id: json['id'],      name: json['name'],      yetkiliKullanicilar: json['yetkiliKullanicilar'] != null ? (json['yetkiliKullanicilar'] as List).map((i) => i.toString()).toList() : [],    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'name': name,      'yetkiliKullanicilar': yetkiliKullanicilar,    };  }}